// import { deepblue, navyblue, teal} from './DisplayPage.js'
import '../Day.css'

function Day({ image1, image2, image3 }) {
    const img3 = null;
    if(image3){
        img3 = <img src={image3} alt="teal" className='teal' id='selec-pic'></img>
    }

    return(
        <div className='day-container'>
        <h2 className='bdate-txt'>April 19th</h2>
        <div className='selection'>
            <img src={image1} alt="" className='deepblue' id='selec-pic'></img>
            <img src={image2} alt="navyblue lipstick" className='navyblue' id='selec-pic'></img>
            { img3 }
        </div>
    </div>
    )
}

export default Day
